import './App.css';
import React, {useEffect, useState} from "react";
import MainServices from "./services/MainServices";
import AppHeader from "./components/AppHeader";

function App() {
    const [machineList, setMachineList] = useState([])

    useEffect(() => {
        GetMachine()
    }, [])

    async function GetMachine() {
        try {
            const resp = await MainServices.getAllMachine();
            setMachineList(resp.data || []);
        } catch (e) {
            console.error(e)
        }
    }

    return (
        <>
            <AppHeader/>
            <div className='md:container md:mx-auto'>
                <div
                    className="rounded overflow-hidden border w-full lg:w-6/12 md:w-6/12 bg-white mx-3 md:mx-0 lg:mx-0">
                    <div className="w-full flex justify-between p-3">
                        <div className="flex">
                            <div
                                className="rounded-full h-8 w-8 bg-gray-500 flex items-center justify-center overflow-hidden">
                                <img src="https://avatars0.githubusercontent.com/u/38799309?v=4" alt="profilepic"/>
                            </div>
                            <span className="pt-1 ml-2 font-bold text-sm">braydoncoyer</span>
                        </div>
                        <span className="px-2 hover:bg-gray-300 cursor-pointer rounded"><i
                            className="fas fa-ellipsis-h pt-2 text-lg"></i></span>
                    </div>
                </div>
            </div>
        </>
    );
}

export default App;
